import{_ as t,o as a,c as l,a7 as p,bf as J,bg as _,bh as s,bi as i,bj as T,bk as e,bl as U,bm as r,bn as c}from"./chunks/framework.nrF9sM7m.js";const A=JSON.parse('{"title":"希捷5400.6 + SSK飙王烈火","description":"","frontmatter":{"title":"希捷5400.6 + SSK飙王烈火","tags":["希捷","评测","移动硬盘"],"id":1083,"categories":["Digital"],"abbrlink":"c1caa861","date":"2009-06-02T15:52:55.000Z"},"headers":[],"relativePath":"Digital/希捷5400.6_SSK飙王烈火.md","filePath":"Digital/希捷5400.6_SSK飙王烈火.md","lastUpdated":1719711816000}'),m={name:"Digital/希捷5400.6_SSK飙王烈火.md"},o=p('<p>自从05年丢过次数据之后，一直坚持做数据备份的习惯，基本是每月做次全盘备份，刻在DVD上，05年至今刻了119来张DVD（有D5有D9，总共481G），如今备份的数据实在太多了，刻盘麻烦，干脆买了个移动硬盘，希捷5400.6 320G + SSK飙王烈火盒子</p><p><img src="'+J+'" alt=""></p><p>皮套做工还不错，也比较厚</p><p><img src="'+_+'" alt=""></p><p>盒子长相比较一般，红色的，要是弄个火焰的图案上去多好呀</p><p><img src="'+s+'" alt=""></p><p>miniUSB接口，外接电源，一键复制，还有eSATA接口，随机附带了eSATA线，不过要主板有这接口才行，没有就要多买个机箱挡板连到主板上的SATA接口，理论上带宽可达3Gb/s，另外接eSATA接口需外接电源（据说可用附带的USB线代替为其提供电源支持）</p><p><img src="'+i+'" alt=""></p><p>盒子内部，防震设计做的并不好，防震条太薄了，侧边也没防震设计</p><p><img src="'+T+'" alt=""></p><p>盒子采用大板设计，所以盒子比较厚，飙王的做工还是不错的</p><p><img src="'+e+'" alt=""></p><p>JM20316芯片，本来打算买黑鹰盒子，也带eSATA，查了下，采用GL830方案，据说JM20336更好，不过飙王没这芯片的盒子，于是买了烈火</p><p><img src="'+U+'" alt=""></p><p>希捷5400.6 320G的笔记本硬盘，8M缓存，单碟160G</p><p><img src="'+r+'" alt=""></p><p>这是做内置硬盘的测试图，因为硬盘是空的，未装系统，就用了张WinPE光盘启动，测试可能有点误差，不过也差不了多少</p><p><img src="'+c+'" alt=""></p><p>这是接USB做移动硬盘的测试图，我自己又试着拷了40G文件，大大小小尺寸都有，平均速度基本在22M/s，速度还算可以</p>',19),M=[o];function S(D,d,I,g,n,y){return a(),l("div",{"data-pagefind-body":!0,"data-pagefind-meta":"base64:"},M)}const E=t(m,[["render",S]]);export{A as __pageData,E as default};
